import React from 'react';

const Cartas = ({ numero, palo }) => {
    const imagen = `./Imagenes/${palo}/${numero}.png`;

    return (
        <div className="carta" style={{ position: 'absolute', top: '53%', left: '50%', transform: 'translate(-50%, -50%)' }}>
        <img src={imagen} alt={`Carta ${numero} de ${palo}`}  style={{ width: '10%', height: '10%' }} />
        </div>
    );
};

export default Cartas;
